style.css:
/* General Reset */
* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}

/* Body Styling */
body {
  font-family: "Comic Sans MS", sans-serif;
  background-color: #f0f0f0;
  color: #333;
  line-height: 1.5;
}

/* Header Styling */
header {
  background-color: #ff6600;
  color: #fff;
  padding: 20px;
  text-align: center;
  border-bottom: 4px solid #cc3300;
}

header h1 {
  font-size: 2.5em;
}

/* Navigation Bar */
nav {
  background-color: #0099cc;
  padding: 10px;
  text-align: center;
  border-bottom: 2px solid #006699;
}

nav a {
  color: #fff;
  text-decoration: none;
  margin: 0 15px;
  font-size: 1.2em;
}

nav a:hover {
  text-decoration: underline;
}

/* Main Content Styling */
main {
  padding: 20px;
  background-color: #fff;
  border: 2px solid #ccc;
  margin: 20px auto;
  width: 80%;
}

main h2 {
  color: #ff6600;
  border-bottom: 2px solid #ff6600;
  padding-bottom: 5px;
}

main p {
  margin: 20px 0;
}

/* Sidebar Styling */
aside {
  background-color: #e0e0e0;
  padding: 15px;
  border: 2px solid #ccc;
  margin: 20px auto;
  width: 80%;
}

aside h3 {
  color: #0099cc;
  border-bottom: 2px solid #0099cc;
  padding-bottom: 5px;
}

aside ul {
  list-style-type: square;
}

aside ul li {
  margin: 10px 0;
}

/* Footer Styling */
footer {
  background-color: #333;
  color: #fff;
  text-align: center;
  padding: 10px;
  margin-top: 20px;
  border-top: 4px solid #666;
}

footer p {
  font-size: 0.9em;
}

/* Buttons Styling */
button {
  background-color: #ff6600;
  color: #fff;
  border: none;
  padding: 10px 20px;
  cursor: pointer;
  font-size: 1em;
  border-radius: 5px;
}

button:hover {
  background-color: #cc3300;
}

/* Tables Styling */
table {
  width: 100%;
  border-collapse: collapse;
  margin: 20px 0;
}

table, th, td {
  border: 1px solid #ccc;
}

th, td {
  padding: 10px;
  text-align: left;
}

th {
  background-color: #0099cc;
  color: #fff;
}

td {
  background-color: #f9f9f9;
}

/* Links Styling */
a {
  color: #0099cc;
  text-decoration: none;
}

a:hover {
  text-decoration: underline;
}
